import express from 'express'
import dbConnction from './config/database'
import routes from './routes/router'
import { Server as WebSocketServer } from 'socket.io'
import http from 'http'
import cors from 'cors'

const app = express()

const httpServer = http.createServer(app)
const io = new WebSocketServer(httpServer, {cors: {origin: '*'}})

io.on('connection', (socket) => {
    console.log('New user connected')
    socket.emit('message', {message: 'Welcome to app'})

    socket.on('call', (data) => {
        console.log(data)
        socket.broadcast.emit('call', data)
    })
})

app.set('port', process.env.PORT_APP || 3000);

httpServer.listen(5000, () => {
    console.log("Socket run on port 5000");
})

app.listen(app.get('port'), () => {
    console.log("Server is running on port " + app.get('port'));
})

app.use(express.json());
app.use(dbConnction)
app.use(cors())


app.get('/', (req, res) => {
    res.json({'message' : 'Welcome to app'});
})

app.use(routes)

